import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    container: {
        height: '100vh'
    }
});

export default function SectionSocial(props){
    const classes = useStyles(); 
    return(
        <div className={classes.container}></div>
    );
}
